INSERT INTO `Books` (`ISBN`, `AuthorID`, `SectionID`, `Title`, `Category`, `Publisher`, `PublishedYear`, `Description`, `CoverPicture`) VALUES ('9781250316776', '79', '27', 'Red, White & Royal Blue', 'Novels', 'St. Martin’s Griffin', '2019', 'A romantic comedy about the First Son of the United States falling in love with a British prince.', 'https://res.cloudinary.com/dde5qpyti/image/upload/v1755483982/book_covers/jr50toryopcyttel4j73.jpg');
INSERT INTO `Books` (`ISBN`, `AuthorID`, `SectionID`, `Title`, `Category`, `Publisher`, `PublishedYear`, `Description`, `CoverPicture`) VALUES ('9781473629165', '3', '1', 'Caraval', 'Novels', 'Flatiron Books', '2016', 'A young adult romantic fantasy set in a Spanish-inspired world that explores the boundaries between fantasy and reality through a magical, interactive theater experience called Caraval.', 'https://res.cloudinary.com/dde5qpyti/image/upload/v1755465678/book_covers/j3wpzb5fzzrzp9hmbllw.webp');
INSERT INTO `Books` (`ISBN`, `AuthorID`, `SectionID`, `Title`, `Category`, `Publisher`, `PublishedYear`, `Description`, `CoverPicture`) VALUES ('9781501142970', '74', '26', 'IT', 'Novels', 'Viking Press', '1986', 'A group of children in Derry, Maine, face a shapeshifting evil entity that emerges every 27 years to prey on the town’s kids. Years later, as adults, they must confront the monster again.', 'https://res.cloudinary.com/dde5qpyti/image/upload/v1755483491/book_covers/hazqlkdu8ulzgkp5whtv.jpg');
INSERT INTO `Books` (`ISBN`, `AuthorID`, `SectionID`, `Title`, `Category`, `Publisher`, `PublishedYear`, `Description`, `CoverPicture`) VALUES ('9781503312753', '94', '29', 'The Hound of the Baskervilles', 'Novels', 'Penguin Classics', '1901', 'Holmes investigates a supernatural-sounding curse on the Baskerville family tied to a spectral hound and the moors—blending gothic atmosphere with rational detective work.', 'https://res.cloudinary.com/dde5qpyti/image/upload/v1755486363/book_covers/zk5ot8cb3jyazcffv78e.jpg');
INSERT INTO `Books` (`ISBN`, `AuthorID`, `SectionID`, `Title`, `Category`, `Publisher`, `PublishedYear`, `Description`, `CoverPicture`) VALUES ('9781668026038', '80', '27', 'Icebreaker', 'Novels', 'Atria Books', '2022', 'A competitive romance between a figure skater and a hockey player forced to share ice time.', 'https://res.cloudinary.com/dde5qpyti/image/upload/v1755484048/book_covers/sdiil6cltfx3fpjiciul.jpg');
INSERT INTO `Books` (`ISBN`, `AuthorID`, `SectionID`, `Title`, `Category`, `Publisher`, `PublishedYear`, `Description`, `CoverPicture`) VALUES ('9781728274867', '99', '32', 'Twisted Love', 'Novels', 'Bloom Books', '2022', 'Ava Chen\'s life is turned upside down when she becomes entangled with her brother\'s best friend, Alex Volkov, a billionaire with a dark past. Their intense chemistry leads to a passionate, yet complicated, relationship.', 'https://res.cloudinary.com/dde5qpyti/image/upload/v1755486967/book_covers/tp5xg996wm0oic4yy1n6.jpg');
INSERT INTO `Books` (`ISBN`, `AuthorID`, `SectionID`, `Title`, `Category`, `Publisher`, `PublishedYear`, `Description`, `CoverPicture`) VALUES ('9781728274898', '99', '32', 'Twisted Lies', 'Novels', 'Bloom Books', '2022', 'Stella Alonso enters a fake relationship with Christian Harper, a tech mogul, to protect herself from a stalker. As their charade deepens, so do their real feelings.', 'https://res.cloudinary.com/dde5qpyti/image/upload/v1755487238/book_covers/vldqntmdv7d1cbaju5a8.png');
INSERT INTO `Books` (`ISBN`, `AuthorID`, `SectionID`, `Title`, `Category`, `Publisher`, `PublishedYear`, `Description`, `CoverPicture`) VALUES ('9781957464060', '99', '32', 'Twisted Games', 'Novels', 'Bloom Books', '2022', 'Princess Bridget of Eldora falls for her bodyguard, Reese Westbrook, leading to a forbidden romance that could jeopardize her royal duties and the kingdom\'s stability.', 'https://res.cloudinary.com/dde5qpyti/image/upload/v1755487020/book_covers/btu1vhbjmw4jghllvlmz.webp');
INSERT INTO `Books` (`ISBN`, `AuthorID`, `SectionID`, `Title`, `Category`, `Publisher`, `PublishedYear`, `Description`, `CoverPicture`) VALUES ('9781981947874', '43', '19', 'Introduction to Philosophy', 'Text Books', 'CreateSpace Independent Publishing Platform', '2017', 'Comprehensive introduction to fundamental philosophical questions, logic, ethics, and metaphysics.', 'https://res.cloudinary.com/dde5qpyti/image/upload/v1755476706/book_covers/rndvgq4afpddu0xe3epb.jpg');
INSERT INTO `Books` (`ISBN`, `AuthorID`, `SectionID`, `Title`, `Category`, `Publisher`, `PublishedYear`, `Description`, `CoverPicture`) VALUES ('GAD2025Jul', '13', '7', 'Stuff UK – July 2025', 'Magazines', 'Kelsey Media', '2025', 'Stuff UK\'s July 2025 issue offers an in-depth look at the latest in consumer technology, featuring reviews of the Samsung Galaxy S25 Edge, Nintendo Switch 2, and a comprehensive guide to home audio systems. The issue also explores advancements in smart home devices and wearable tech.', 'https://res.cloudinary.com/dde5qpyti/image/upload/v1755468081/book_covers/cq6yrbemcm2s2qdsg0ka.jpg');
INSERT INTO `Books` (`ISBN`, `AuthorID`, `SectionID`, `Title`, `Category`, `Publisher`, `PublishedYear`, `Description`, `CoverPicture`) VALUES ('JP2011Feb', '13', '2', 'Japanese Performance', 'Magazines', 'Seymour Distribution Ltd', '2011', 'Japanese Performance is a monthly magazine dedicated to Japanese car culture and tuning. It showcases the best-tuned Japanese cars globally, featuring models like the Nissan GT-R, Toyota Supra, and Mazda RX-7. The magazine includes in-depth articles on performance modifications, tuning trends, and profiles of notable vehicles and owners.', 'https://res.cloudinary.com/dde5qpyti/image/upload/v1755470292/book_covers/tb2bi4eijsqy6ok2dfsg.webp');
INSERT INTO `Books` (`ISBN`, `AuthorID`, `SectionID`, `Title`, `Category`, `Publisher`, `PublishedYear`, `Description`, `CoverPicture`) VALUES ('JP2019Oct', '13', '2', 'Japanese Performance', 'Magazines', 'Seymour Distribution Ltd', '2019', 'Japanese Performance is a monthly magazine dedicated to Japanese car culture and tuning. It showcases the best-tuned Japanese cars globally, featuring models like the Nissan GT-R, Toyota Supra, and Mazda RX-7. The magazine includes in-depth articles on performance modifications, tuning trends, and profiles of notable vehicles and owners.', 'https://res.cloudinary.com/dde5qpyti/image/upload/v1755470145/book_covers/zjuhwuiy6ighbr9nw6wm.jpg');
INSERT INTO `Books` (`ISBN`, `AuthorID`, `SectionID`, `Title`, `Category`, `Publisher`, `PublishedYear`, `Description`, `CoverPicture`) VALUES ('MC2025Jul', '13', '2', 'Muscle Car Review', 'Magazines', 'Source Interlink Media', '2025', 'Muscle Car Review is a monthly magazine that focuses on classic American muscle cars from the 1960s and 1970s. It features detailed restorations, performance upgrades, and historical insights into iconic models like the Chevrolet Camaro, Ford Mustang, and Dodge Charger. The magazine appeals to enthusiasts and collectors interested in preserving and restoring classic muscle cars.', 'https://res.cloudinary.com/dde5qpyti/image/upload/v1755470501/book_covers/brksvhsqv7qchzmxzwgp.webp');
INSERT INTO `Books` (`ISBN`, `AuthorID`, `SectionID`, `Title`, `Category`, `Publisher`, `PublishedYear`, `Description`, `CoverPicture`) VALUES ('Tech2025Jul', '14', '7', 'IEEE Spectrum – July 2025 ', 'Magazines', 'IEEE', '2025', 'The July 2025 issue of IEEE Spectrum delves into cutting-edge developments in technology, including the impact of the Rubin Observatory on astronomy, innovations in ultrasound therapy targeting inflammation and diabetes, and the integration of autonomous surgical robots in medical procedures.', 'https://res.cloudinary.com/dde5qpyti/image/upload/v1755468179/book_covers/k8skp07ixq3mca37kkyv.webp');
